import React, { useState, useEffect } from 'react'





export const Display = () => {

    useEffect(() => {
        axios.get('http://localhost:8000/api/pirates')
            .then(res => {
                console.log(res.data)
            })
            .catch(err => console.log(err))
    })



    return (
        <div>Display</div>

    )
}

export default Display;
